My Pregnancy is a week-by-week pregnancy tracker. Our app will help you over the course of your pregnancy. Stay on top of the changes happening inside your body. Find out how your baby is developing.

Our app is completely free and does not contain advertising.

This app includes:
- week-by-week advice;
- useful information on fetal development and changes in your body;
- week-by-week fetal measurements and imaging;
- a to-do list for each trimester;
- a list of things you will need for hospital check-in, post-natal care and check-out;
- a weight tracker you can use to follow weight gain;
- a kick counter;
- a contraction timer;
- and much more

We have created this app with love, specially for young mothers.

This app is not intended for medical use and is not a substitute for medical consultation.

If you have any questions or requests, please write to neumandev@gmail.com. We are eager to hear your comments on how to improve the app.

Improve Care Coordination

Gain Insight and prepare for Value-based care

* Preventive Health Monitoring
Research has shown that Prevention and Early detection saves lives, and creates long term returns. Many organizations have failed to implement Preventive programs successfully.

Automate the preventive guidance of higher-risks individuals before disease strikes.

* Active Treatment Coordination
Patients provide valuable insights into their perception of delivery of care. Transform protracted or multi-step care paths into real-time continua. Follow patients before, during and after treatment.

Create an extra-muros care coordination and maintain the trust relation with your patient

* Patient Outcome Measurement
Research has shown that Prevention and Early detection saves lives, and creates long term returns. Many organizations have failed to implement Preventive programs successfully.

Gather repeated patient-reported data about quality and quantity of life, late after therapeutic pathways gather outcome performance data.

* HOW IT WORKS?
Meplis Care Monitor can help you on a broad range of projects going from existing questionnaires / protocols up fully tailored questionnaires with data capturing.

1 - Create or Select: The relevant monitoring track
2 - Invite your Patient: Via Web and/or Mobile
3 - Monitor the Patient: Reported data on a user friendly dashboard
4 - Get Notified: In case of deviations, adapt the care path to the needs of your patient

